export default class SearchBar extends Component {
    render() {
        return (
           <form>
               <input type ="text" placeholder="Search"/>
               <Button></Button>
            </form>
        )
    }
}


const styles = {
    searchBarContainer : {
        margin:'10px',
    }
}
